import React, { useState, useEffect } from 'react';
import './App.css';

const API_URL = 'http://localhost:3001/cars';

function App() {
  const [cars, setCars] = useState([]); // Lista de autos
  const [newCar, setNewCar] = useState({
    marca: '',
    modelo: '',
    descripcion: '',
    valor: '',
    existencia: '',
    colores_disponibles: '',
  });

  // Cargar la lista de autos al inicio
  useEffect(() => {
    fetchCars();
  }, []);

  const fetchCars = async () => {
    try {
      const response = await fetch(API_URL);
      const data = await response.json();
      setCars(data);
    } catch (error) {
      console.error('Error fetching cars:', error);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewCar({ ...newCar, [name]: value });
  };

  const handleCreate = async () => {
    try {
      const response = await fetch(API_URL, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newCar),
      });

      if (response.ok) {
        fetchCars(); // Actualiza la lista después de agregar
        setNewCar({
          marca: '',
          modelo: '',
          descripcion: '',
          valor: '',
          existencia: '',
          colores_disponibles: '',
        }); // Limpia el formulario
      }
    } catch (error) {
      console.error('Error creating car:', error);
    }
  };

  const handleDelete = async (id) => {
    try {
      const response = await fetch(`${API_URL}/${id}`, {
        method: 'DELETE',
      });

      if (response.ok) {
        fetchCars(); // Actualiza la lista después de eliminar
      }
    } catch (error) {
      console.error('Error deleting car:', error);
    }
  };

  return (
    <div className="App">
      <h1>Autos en Venta</h1>
      <div className="form">
        <h2>Agregar Auto</h2>
        <input
          type="text"
          name="marca"
          placeholder="Marca"
          value={newCar.marca}
          onChange={handleInputChange}
        />
        <input
          type="text"
          name="modelo"
          placeholder="Modelo"
          value={newCar.modelo}
          onChange={handleInputChange}
        />
        <textarea
          name="descripcion"
          placeholder="Descripción"
          value={newCar.descripcion}
          onChange={handleInputChange}
        />
        <input
          type="number"
          name="valor"
          placeholder="Valor"
          value={newCar.valor}
          onChange={handleInputChange}
        />
        <input
          type="number"
          name="existencia"
          placeholder="Existencia"
          value={newCar.existencia}
          onChange={handleInputChange}
        />
        <input
          type="text"
          name="colores_disponibles"
          placeholder="Colores disponibles (separados por comas)"
          value={newCar.colores_disponibles}
          onChange={handleInputChange}
        />
        <button onClick={handleCreate}>Agregar Auto</button>
      </div>

      <div className="cars-list">
        <h2>Lista de Autos</h2>
        {cars.map((car) => (
          <div key={car.id} className="car-item">
            <h3>{car.marca} {car.modelo}</h3>
            <p>{car.descripcion}</p>
            <p><strong>Valor:</strong> ${car.valor}</p>
            <p><strong>Existencia:</strong> {car.existencia}</p>
            <p><strong>Colores:</strong> {car.colores_disponibles}</p>
            <button onClick={() => handleDelete(car.id)}>Eliminar</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
